import { Component, OnInit } from '@angular/core';
import { HttpClient } from '@angular/common/http';

interface Test {
  TestId: number;
  Name: string;
}

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent implements OnInit {
  title = 'test';
  tests: Test[] = [];
  newTest: Test = { TestId: 0, Name: "Test1" };

  constructor(private http: HttpClient) {}

  ngOnInit() {
    this.getTests();
  }

  async getTests() {
    try {
      const apiUrl = 'http://localhost:5177/api/tests'; // Update the API URL to your endpoint
      const res = await this.http.get<Test[]>(apiUrl).toPromise();
      console.log(res);
      this.tests = res;
    } catch (error) {
      console.error('Failed to fetch tests', error);
    }
  }

  sendTest() {
    const apiUrl = 'http://localhost:5177/api/tests'; // Update the API URL to your endpoint
    this.http.post<Test>(apiUrl, this.newTest).subscribe({
      next: (res) => console.log(res),
      error: (err) => console.error('Failed to send test', err)
    });
  }
}
<app-navbar></app-navbar>
<router-outlet></router-outlet>
<app-voyage-create></app-voyage-create>
<div *ngFor="let voyage of voyages">
  <app-voyage-card [voyage]="voyage"></app-voyage-card>
</div>
<app-footer></app-footer>
